function generateRandomPlanePartition(){var r=Math.floor(3*Math.random())+5,a=Math.floor(5*Math.random())+10,o=new Array(r);for(let t=0;t<r;t++)o[t]=new Array(r);o[0][0]=a;for(let n=1;n<r;n++)o[0][n]=Math.max(o[0][n-1]-Math.floor(4*Math.random()),0);for(let e=1;e<r;e++){o[e][0]=Math.max(o[e-1][0]-Math.floor(4*Math.random()),0);for(let a=1;a<r;a++)o[e][a]=Math.max(Math.min(o[e][a-1],o[e-1][a])-Math.floor(4*Math.random()),0)}for(let h=0;h<r;h++)o[r-1][h]=0,o[h][r-1]=0;return o}function generateRandomTableau(){var r=Math.floor(3*Math.random())+5,o=new Array(r);for(let t=0;t<r;t++){o[t]=new Array(r);for(let a=0;a<r;a++)Math.random()<.75/r?o[t][a]=Math.floor(3*Math.random())+1:o[t][a]=0}for(let a=0;a<r;a++)o[a][r-1]=0,o[r-1][a]=0;return o}function generateRandomSsyt(){var r=Math.floor(3*Math.random())+2,o=new Array(r);for(let a=0;a<r;a++)o[a]=new Array(r);o[0][0]=Math.floor(2*Math.random());for(let t=1;t<r;t++)o[0][t]=o[0][t-1]+Math.floor(2*Math.random());for(let n=1;n<r;n++){o[n][0]=o[n-1][0]+1+Math.floor(2*Math.random());for(let a=1;a<r;a++)o[n][a]=Math.max(o[n][a-1],o[n-1][a]+1)+Math.floor(2*Math.random())}return o}export{generateRandomPlanePartition,generateRandomTableau,generateRandomSsyt};